		"full_text": "프로그램이 미덥지 못하다는 것이 아니라 티스토리 정책이 바뀌면 어떻게 될 지 모르니까. 국내 기업의 이런 것을 많이 봐왔으니까. 적어도 유저가 사용자가 내보내기 Export 할 수 있는 서비스를 쓰고 싶음. 국내 법 적용 받아서 표현도 제약되는 곳 말고.",
