		"id_str": "1290641853197385728",
		"full_text": "보통 플랫폼 고객센터나 커뮤니티는 포럼형+채팅형으로 운영하는데 대개 레딧과 디스코드를 이용한다. 그러나 한국에서는 페이스북 그룹과 카카오톡 오픈채팅이나 실명채팅방을 쓴다. 후자의 경우 크게 걸리는 문제가 있지만 접근성에 있어서는 아무리 좋은 것도 뛰어넘을 수 없다.",
