		"full_text": "직접 만든 구글 스프레드시트보다 나은 것은 UI/UX 좋다는 것뿐. 많이 부족한 서비스이고 매리트가 있으려면 서비스별 해지옵션을 잘 정리해서 제공해야. 일괄 해지 같은 기능 수요를 채워주진 못할 것이다. 이유는 앞서 말한 것과 같음.\n\n#구독관리",
