		"full_text": "레드벨벳은 V자 형태를 만들고 응용하는 동작을 안무에 수없이 넣는다. (귀찮아서 캡쳐는 안 했지만 찾아보면 정말 많다. 가장 노골적이었던 건 &lt;RBB&gt;.) &lt;놀이 Naughty&gt; 무대 세트에도... 뮤비에도 넣는다. &lt;Monster&gt;가 그렇다. V자 구도가 비중있게 이용된다. 아래 캡쳐는 특히 눈여겨볼 두 장면이다.",
